  Script: |+
    // Our map of owner object IDs to their respective beach balls.
    ballMap := make(map[uint32]ObjectI)

    // Give every owner their own ball when they join, and remove it when they leave.
    func OnOwnerJoin(owner OwnerI) {
        if t := owner.GetTarget(); t != nil {
            tile := t.GetTile()
            if o, err := world.CreateObject("items/beach-ball"); err == nil {
                ballMap[t.GetID()] = o
                gmap.PlaceObject(o, tile.Y, tile.X, tile.Z)
            }
        }
    }
    func OnOwnerLeave(owner OwnerI) {
        if t := owner.GetTarget(); t != nil {
            if o, ok := ballMap[t.GetID()]; ok {
                world.DeleteObject(o, true)
                delete(ballMap, t.GetID())
            }
        }
    }

    func OnCleanup() {
        fmt.Println("Tidying the beach...")
    }

    func OnSleep() {
        fmt.Println("Beach inactivated")
    }

    func OnWake() {
        fmt.Println("Beach activated")
    }
    /*func OnUpdate(delta time.Duration) {
        fmt.Println("time!", delta)
    }*/

